// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

// try and catch can only catch errors from external function calls and contract creation.

// external contrat used for try and catch examples

contract Foo {
    address public owner;
    uint public x;

    constructor(address _owner) {
        require(_owner != address(0), "invalid address");
        assert(_owner != 0x0000000000000000000000000000000000000001);
        owner = _owner;
    }

    function setX(uint _x) public {
        require(_x > 10, "invalid value");
        x = _x;
    }

    function myFunc(uint _x) public pure returns (string memory) {
        require(_x != 0, "require failed");
        return "myFunc was called!";
    }
}

contract Bar {
    event Log(string message);
    event LogBytes(bytes data);

    Foo public foo;

    constructor() {
        // foo contract is used for example of try catch with external call
        foo = new Foo(msg.sender);
    }

    // exmaple of try catch with external call
    // tryCatchExternalCall(0) => Log("external call failed")
    // tryCatchExternalCall(1) => Log("my func was called")
    function tryCatchExternalCall(uint _i) public {
        try foo.myFunc(_i) returns (string memory result) {
            emit Log(result);
        }
        catch {
            emit Log("external call failed");
        }
    }

    // Example of try / catch with contract creation
    // tryCatchNewContract(0x0000000000000000000000000000000000000000) => Log("invalid address")
    // tryCatchNewContract(0x0000000000000000000000000000000000000001) => LogBytes("")
    // tryCatchNewContract(0x0000000000000000000000000000000000000002) => Log("Foo created")

    function tryCatchNewContract(address _owner) public {
        try new Foo(_owner) returns (Foo _foo) {
            // use foo var here
            _foo.setX(100);
            emit Log("Foo created");
        }
        catch Error(string memory reason) {
            emit Log(reason);
        }
        catch (bytes memory reason) {
            // catch failing assert()
            emit LogBytes(reason);
        }
    }
}

